import {Link} from 'react-router-dom'

import './SearchBlock.css'
// компонент не используется
let localUser =  JSON.parse(localStorage.getItem('user'))
const name=localUser.email.toLowerCase()
export default function SearchBlock({user}) {

  return (
    <div className="searchBlockContainer">
      <div className="searchBlock">
        <div className="searchNames">
          <Link to={`/profile/${user.id}`} className='searchName'><span>{name.charAt(0).toUpperCase() + name.slice(1)}</span></Link>
          {/*<div className='department'>{user.department_id}</div>*/}
          <div className='email'>{user.email}</div>
        </div>
      </div>
    </div>
  )
}
